import * as React from 'react';
import AppBar from '@mui/material/AppBar';
import Box from '@mui/material/Box';
import Toolbar from '@mui/material/Toolbar';
import IconButton from '@mui/material/IconButton';
import { ThemeProvider } from '@mui/material/styles';
import Typography from '@mui/material/Typography';
import Menu from '@mui/material/Menu';
import MenuIcon from '@mui/icons-material/Menu';
import Container from '@mui/material/Container';
import Avatar from '@mui/material/Avatar';
import Button from '@mui/material/Button';
import Tooltip from '@mui/material/Tooltip';
import MenuItem from '@mui/material/MenuItem';
import AccountCircleTwoToneIcon from '@mui/icons-material/AccountCircleTwoTone';
import { Link, useNavigate } from "react-router-dom";
import theme from './../theme';
import logo from './../together.png';
import validateToken from './../requests/ValidateToken';
import LogoutRequest from './../requests/LogoutRequest';

const pages = ['Accueil', 'S\'informer', 'S\'engager', 'À propos'];

window.$settings = ['Connexion', 'Inscription'];

const ResponsiveAppBar = () => {
  const [anchorElNav, setAnchorElNav] = React.useState(null);
  const [anchorElUser, setAnchorElUser] = React.useState(null);
  // eslint-disable-next-line
  const [status, setStatus] = React.useState(0);

  const handleOpenNavMenu = (event) => {
    setAnchorElNav(event.currentTarget);
  };
  const handleOpenUserMenu = (event) => {
    setAnchorElUser(event.currentTarget);
  };

  const handleCloseNavMenu = () => {
    setAnchorElNav(null);
  };

  const handleCloseUserMenu = () => {
    setAnchorElUser(null);
  };

  const navigate = useNavigate();

  React.useEffect((status) => {
      validateToken({status, setStatus});
      if (status===200) {
        window.$settings = ['Accueil', 'S\'informer', 'S\'engager', 'À propos'];
      }
      else {
        window.$settings = ['Connexion', 'Inscription'];
      }
   }, []);

  const getNavPage = (page) => {
    handleCloseNavMenu();
    handleCloseUserMenu();
    if (page==="S'informer") {
      return "/sinformer/contraception";
    }
    if (page==="S'engager") {
      return "/sengager";
    }
    if (page==="À propos") {
      return "/apropos";
    }
    if (page==="Connexion") {
      return "/connexion";
    }
    if (page==="Inscription") {
      return "/inscription";
    }
    if (page==="Mon profil") {
      return "/profil";
    }
    if (page==="Mes paramètres") {
      return "/parametres";
    }
    if (page==="Ma contraception") {
      return "/macontraception";
    }
    if (page==="Déconnexion") {
      LogoutRequest();
      return "/";
    }
    else {
      return "/";
    }
  };

  return (
    <ThemeProvider theme={theme}>
    <AppBar position="static">
      <Container maxWidth="xl">
        <Toolbar disableGutters>
        <Box className="App-Box" sx={{ cursor:'pointer', display: { xs: 'none', md: 'flex' }}}>
        <Link to="/">
          <img src={profile} className="App-Logo" alt="logo"/>
        </Link>
          <Typography
            variant="h6"
            noWrap
            component="a"
            href="/"
            color='secondary'
            sx={{
              mr: 2,
              display: { xs: 'none', md: 'flex' },
              FontFamily: 'roboto',
              fontWeight: 1000,
              textAlign: 'center',
              textDecoration: 'none',
            }}
          >
            Maxence Lefort - Product Manager
          </Typography>
          </Box>

          <Box sx={{ flexGrow: 1, cursor:'pointer', display: { xs: 'flex', md: 'none' } }}>
            <IconButton
              size="large"
              aria-label="account of current user"
              aria-controls="menu-appbar"
              aria-haspopup="true"
              onClick={handleOpenNavMenu}
              color="inherit"
            >
              <MenuIcon />
            </IconButton>
            <Menu
              id="menu-appbar"
              anchorEl={anchorElNav}
              anchorOrigin={{
                vertical: 'bottom',
                horizontal: 'left',
              }}
              keepMounted
              transformOrigin={{
                vertical: 'top',
                horizontal: 'left',
              }}
              open={Boolean(anchorElNav)}
              onClose={handleCloseNavMenu}
              sx={{
                cursor:'pointer',
                display: { xs: 'block', md: 'none' }
              }}
            >
              {pages.map((page) => (
                <MenuItem key={page} onClick={() => navigate(`${getNavPage(page)}`)}>
                  <Typography textAlign="center">{page}</Typography>
                </MenuItem>
              ))}
            </Menu>
          </Box>
          <Typography
            variant="h6"
            noWrap
            component="a"
            href=""
            color='secondary'
            sx={{
              mr: 0,
              display: { xs: 'flex', md: 'none' },
              flexGrow: 1,
              FontFamily: 'roboto',
              fontWeight: 1000,
              textDecoration: 'none'
            }}
          >
            Des hommes féministes
          </Typography>
          <Box sx={{
            flexGrow: 1, display: { xs: 'none', md: 'flex' }}}>
            {pages.map((page) => (
              <Button
                key={page}
                onClick={() => navigate(`${getNavPage(page)}`)}
                sx={{my: 2, color: 'white', display: 'block' }}
              >
              {page}
              </Button>
            ))}
          </Box>

          <Box sx={{ flexGrow: 0}}>
            <Tooltip title="Mon compte">
              <IconButton  onClick={handleOpenUserMenu}>
              <Avatar sx={{backgroundColor: '#F0F8FF'}}>
                <AccountCircleTwoToneIcon color='secondary'/>
              </Avatar>
              </IconButton>
            </Tooltip>
            <Menu
              sx={{ mt: '45px', cursor:'pointer' }}
              id="menu-appbar"
              anchorEl={anchorElUser}
              anchorOrigin={{
                vertical: 'top',
                horizontal: 'right',
              }}
              keepMounted
              transformOrigin={{
                vertical: 'top',
                horizontal: 'right',
              }}
              open={Boolean(anchorElUser)}
              onClose={handleCloseUserMenu}
            >
              {window.$settings.map((setting) => (
                <MenuItem key={setting} onClick={() => navigate(`${getNavPage(setting)}`)}>
                  <Typography textAlign="center">{setting}</Typography>
                </MenuItem>
              ))}
            </Menu>
          </Box>
        </Toolbar>
      </Container>
    </AppBar>
    </ThemeProvider>
  );
};
export default ResponsiveAppBar;
